import datas from '../data/data';
import Card from '../components/Card';
import '../style/gallery.scss';

export default function Slider() {

    return (
        <main className='slider'>
            {datas.map(data => {
                return (
                    <Card
                        key={data.id}
                        id={data.id}
                        cover={data.cover}
                        title={data.title}
                        pictures={data.pictures}
                        description={data.description}
                        host={data.host}
                        rating={data.rating}
                    />
                )
            })}
        </main>
    )
}
